// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.8.4;
import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Artifact is ERC1155, Ownable{

    enum Status {
        Created,
        Minted,
        Hodl,
        Staked,
        Paused
    }

    string public NAME;
    address private CREATOR;
    address private HODLER;
    uint private PRICE;
    Status private STATUS;
    uint public ID;
    uint public AMOUNT;
    address MARKETX;
    address[] public LEDGER;
    uint private N_LEDGER = 0;

    constructor(string memory _uri, string memory _name, uint _id, uint _amount, uint _price, address _creator, address _marketX) ERC1155(_uri) public {
        NAME = _name;
        STATUS = Status.Created;
        MARKETX = _marketX;
        CREATOR = _creator;
        AMOUNT = _amount;
        PRICE = _price;
        ID = _id;
        LEDGER.push(_creator);
        N_LEDGER++;
        setApprovalForAll(_marketX,true);
    }

    modifier onlyMarketX(){
        require(msg.sender == MARKETX,"Artifact: Only MarketX");
        _; 
    }

    function mint(address _to) public onlyMarketX {
        STATUS = Status.Minted;
        HODLER = _to;
        LEDGER.push(_to);
        N_LEDGER++;
        _mint(_to,ID,AMOUNT,"");
    }

    function idToName(uint _id) public view returns(string memory) {
        require(_id == ID, "Artifact: Invalid ID for this Artifact");
        return NAME;
    }

    function transfer(address _buyer) public onlyMarketX{
        safeTransferFrom(HODLER, _buyer, ID, AMOUNT, "");
        HODLER = _buyer;
        STATUS = Status.Hodl;
        LEDGER.push(_buyer);
        N_LEDGER++;
    } 

    function getHodler() public view returns(address) {
        return HODLER;
    }

    function getCreator() public view returns(address) {
        return CREATOR;
    }

    function setStatus(Status _newStatus) public onlyMarketX {
        STATUS = _newStatus;
    }
 
    function getStatus() public onlyMarketX view returns(Status){
        return STATUS;
    }

    function getData() public view returns(uint,uint,uint,Status){
        return (ID,PRICE,N_LEDGER,STATUS);
    }

    function getPrice() public view returns(uint){
        return PRICE;
    }


}
